import { Stack } from '@mui/system';
import React from 'react'
import { banner } from '../../data/Data';
import "./Banner.css";

function Banner() {
    
  return (
    <>
    <h1>Banner</h1>
    {banner.map((items)=> (
        <Stack>
            <img key={items.id} src={items.cover} alt=""/>
        </Stack>
    ))}
    </>
  )
  }
export default Banner
